Savinõukillud, 2 mõlemad killud hästipõletatud käsitsivormitud nõudest, ornamendita;
a) koostises keskmise jämedusega liiv, pinnad veidi mõranenud, värvilt pruunikas ja hall;
b) eelmisest veidi peenema koostisega, pinnad hea töötlusega, värvilt pruun ja hall; e.-v. kolmnurkse kujuga  Saadud Mati Mandeli juhatatud kaevamistel 1979.a.

